import React, { useState, useEffect } from 'react';
import { Container, Form, Button, Alert, Spinner } from 'react-bootstrap';
import { useParams, useNavigate } from 'react-router-dom';
import { getRaceById, updateRace } from '../services/raceService';

const RaceEditPage = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [race, setRace] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [formData, setFormData] = useState({
    name: '',
    laps: 0,
    location: '',
    description: ''
  });
  const [saveSuccess, setSaveSuccess] = useState(false);

  useEffect(() => {
    const fetchRace = async () => {
      try {
        const data = await getRaceById(id);
        setRace(data);
        setFormData({
          name: data.name,
          laps: data.laps,
          location: data.circuit ? data.circuit.name : '',
          description: data.description || ''
        });
      } catch (err) {
        setError('Không thể tải thông tin chặng đua. Vui lòng thử lại sau.');
        console.error('Error fetching race:', err);
      } finally {
        setLoading(false);
      }
    };

    fetchRace();
  }, [id]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    setSaveSuccess(false);

    try {
      // Prepare data for API
      const updateData = {
        ...race,
        name: formData.name,
        laps: parseInt(formData.laps, 10)
        // Note: In a real app, you would need to handle circuit updates differently
        // This is simplified for the example
      };

      await updateRace(id, updateData);
      setSaveSuccess(true);
    } catch (err) {
      setError('Có lỗi xảy ra khi lưu thông tin. Vui lòng thử lại sau.');
      console.error('Error updating race:', err);
    } finally {
      setLoading(false);
    }
  };

  const handleConfirm = () => {
    navigate('/race-management');
  };

  if (loading && !race) {
    return (
      <Container className="d-flex justify-content-center mt-5">
        <Spinner animation="border" role="status">
          <span className="visually-hidden">Đang tải...</span>
        </Spinner>
      </Container>
    );
  }

  if (error && !race) {
    return (
      <Container>
        <Alert variant="danger">{error}</Alert>
        <Button variant="secondary" onClick={() => navigate('/race-management')}>
          Quay lại
        </Button>
      </Container>
    );
  }

  return (
    <Container className="form-container">
      <h2 className="page-title">Chỉnh sửa thông tin chặng đua</h2>

      {saveSuccess && (
        <Alert variant="success">
          Lưu thông tin thành công!
          <Button variant="outline-success" className="ms-3" onClick={handleConfirm}>
            OK
          </Button>
        </Alert>
      )}

      {error && <Alert variant="danger">{error}</Alert>}

      <Form onSubmit={handleSubmit}>
        <Form.Group className="mb-3">
          <Form.Label>ID</Form.Label>
          <Form.Control type="text" value={id} disabled />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Tên chặng đua</Form.Label>
          <Form.Control 
            type="text" 
            name="name" 
            value={formData.name} 
            onChange={handleChange}
            required
          />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Số vòng đua</Form.Label>
          <Form.Control 
            type="number" 
            name="laps" 
            value={formData.laps} 
            onChange={handleChange}
            required
            min="1"
          />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Địa điểm</Form.Label>
          <Form.Control 
            type="text" 
            name="location" 
            value={formData.location} 
            onChange={handleChange}
            disabled
          />
          <Form.Text className="text-muted">
            Địa điểm không thể chỉnh sửa trực tiếp. Vui lòng cập nhật thông tin đường đua.
          </Form.Text>
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Mô tả</Form.Label>
          <Form.Control 
            as="textarea" 
            rows={3} 
            name="description" 
            value={formData.description} 
            onChange={handleChange}
          />
        </Form.Group>

        <Button 
          variant="primary" 
          type="submit" 
          className="f1-primary-btn"
          disabled={loading}
        >
          {loading ? 'Đang lưu...' : 'Lưu'}
        </Button>{' '}
        <Button 
          variant="secondary" 
          onClick={() => navigate('/race-management')}
        >
          Hủy
        </Button>
      </Form>
    </Container>
  );
};

export default RaceEditPage;
